import React from "react";
import { Link } from "react-router-dom";

const About = ()=>{
    return (
    <>
    <div>
    <ul id='nav'>
      <li><Link to="/register" className='a'>Register</Link></li>
         <li><Link to="/login" className='a'>Login</Link></li>
      </ul>
    </div>
    </>
    )
}

export default About;
